var zone = msg.topic.split('/')[1];

var zone_names={
    6: 'Wet Bay',
    7: 'Generator Bay'
};

// Temporary until I decide if I like 0.5 increments
var round = true;

if (zone in zone_names) {
    data = {};
    data.zone_name = zone_names[zone];
    data.ambient_temp = msg.payload.ambient_temp;
    if (round) {
        data.ambient_temp = Math.round(data.ambient_temp*2)/2;
    }
    data.unit = msg.payload.unit;
    msg.payload = data; // Get rid of things that might confuse RBE

    messages = [null, null];
    messages[zone - 6] = msg;
    return messages;
}
